import Link from 'next/link';

const Navbar = () => (
<div>



    <ul>
    <li>
        <Link href="/"><a>Home</a></Link>    </li>
        <li><Link href="/about"><a>About</a></Link></li>


</ul>

        <style jsx>{`
    ul{
        height: 100vh;
        width: 20%;
        background: #333;
        color: #fff;
        display: inline;
    }
    ul li{
        font-size:18px;
        margin-right:20px;
    }
    ul li a{
        color: #fff;
        text-decoration: none;
    }


`}</style>
</div>


);


export default Navbar;
